          <TableRow>
            {columns.map((item) => {
              <StyledTableCell>{item.headerName}</StyledTableCell>;
            })}
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map((client) => (
            <StyledTableRow key={client.id}>
              
              <StyledTableCell>{client.firstName}</StyledTableCell>
              
              <StyledTableCell>
                {`${client.address.street}, ${client.address.city}, ${client.address.country} - ${client.address.buildingNumber}`}
              </StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
